import React from 'react';

//form page
const FilterS = (props) => {
   function filter() {

    }

    return (
        <div
        className="sho rounded-pill d-grid justify-content-center align-items-center grid-wrap"
        style={{
          width: "76vw",
          height: "13vh",
          backgroundColor: "rgb(35 52 72)",
        }}
      >
        <div
          className="sho rounded-pill d-flex justify-content-center align-items-center grid-wrap"
          style={{
            position: "relative",
            width: "74vw",
            backgroundColor: "rgb(76 104 133)",
            height: "10vh",
            bottom: 3,
          }}
        >

          <input className="sho rounded-pill" style={{color: '#f2ebeb',backgroundColor:'#797d99',border:'none', width: '30vw', position: 'relative', right: '14vw', top: '-.25vh'}}></input> 
<select style={{color: '#f2ebeb',backgroundColor:'#797d99',border:'none', width: 'auto', position: 'relative',}} className="sho rounded-pill">
    <option onClick={filter} value="0">All Items</option>
    <option onClick={filter} value="0">One Piece</option>
    <option onClick={filter} value="0">Dragonball</option>
    <option>Naruto</option>
    <option>Bleach</option>
    <option>Demon Slayer</option>
    <option>My Hero Academy</option>
    <option>One Punch Man</option>
    <option>DeathNote</option>
    <option>Braclets</option>
    <option>Key Chains</option>
    <option>Necklace</option>
    <option>Lanyard</option>
</select>
      </div>
      </div>
    );
}

export default FilterS;
